import React from 'react';
import { Link  } from '@reach/router'
import Topics from './Topics';
import Toggle from './Toggle'
import styles from '../css modules/Header.module.css'
import img from '../hom'


const Header = () => {
  return (
    <header>
      <h1 className="page-title">northcoders news</h1>
      <nav>
        <ul>
          <li className="navbar"><Link to="/" className="home-button">Home</Link></li>
        <li className="navbar">
          <Toggle buttonName="Topics" className="topics-button">
          <Topics />
        </Toggle></li>
        </ul>

      </nav>
    </header>
  );
};

export default Header;
